select round((visit_count*12000.0/member_months),2)
from (select sum(visit_count) visit_count from l5.visit_pcp hp
left join L5.pcp p on hp.org_hierarchy_master_id = p.org_hierarchy_master_id
left join L5.payer p2 on hp.payer_master_id = p2.payer_master_id
where month_of_visit ${Date}
and visit_sub_type= 'SNF Inpatient Claim'
and ${Conract_var}) t1
left join (select count(${default_file_name}) member_months from L5.attribution_patient
where ${Conract_var}
and month_of_attribution ${Date}) t2 on true;
